- input: "TEXT\x1CC00167130\x1CX0\x1C\x1CF3XA\x1CThe Committee is amending this report
    to Correct the Levin L and L-B Schedules where a bank fee was inadvertently not
    included on the previously filed report.  -  Travel Stipend on this report were
    not cash payments; furthermore, these payments were monthly stipend payments in
    accordance with policies of the committee and not a reimbursement for any specific
    travel expense. In addition, a duplicate in the database was discovered and merged
    which in turn made the donor move from un-itemized to itemized which is reflected
    on the detailed summary pages. - Employees that were disclosed on Schedule H4
    supporting Line 21(a) and Schedule B supporting Line 21(b) as payroll spent less
    than 25% of their time during the period working on any Federal Election Activity
    or activities in connection with a Federal Election therefore salary payments
    were allocable.  This also includes fringe benefits for those specific employees.
    - Any fundraising activity on this report was for the sole benefit of the Committee
    and was not attributable to any candidate for federal office. - Memo Schedule
    A's that itemize the committees share of the gross contributions received through
    the joint fundraising activities from the Keystone Victory Fund are provided on
    this report. The transfer of the joint fundraising proceeds received during this
    reporting period represents the committee's share of proceeds for contributions
    received this period. - Memo Schedule A's that itemize the committees share of
    the gross contributions received through the joint fundraising activities from
    the DNC State Party Victory Fund and or ASDC Dollars for Democrats are provided
    on a quarterly basis. The transfer of the joint fundraising proceeds received
    during this reporting period represents the committee's share of proceeds for
    contributions received during this or prior reporting periods. The memo entries
    for these contributions are included in this or a prior report of the committee.
    - No national transfers were designated for any activity that meets the definition
    of exempt.\n"
